import { firebase } from  '../utils/firebase'

export default function Home() {

  React.useEffect(() => {
    const obtenerDatos = async () => {
      try {
        const db = firebase.firestore();
        const data = await db.collection('users').get();
        console.log(data);
      } catch (error) {
        console.log(error);
      }
    };

    obtenerDatos();

  },[])

  return (
    <div>
      <h1>Art-Hispano</h1>
    </div>
  )
}
